class Restaurant extends Component {

    constructor(resturantStore) {
        console.log(resturantStore);
        this.name = resturantStore.name
        this.imageUrl = resturantStore.image_url;
        this.ulr = resturantStore.url;
        this.rating = resturantStore.rating;
        this.price = resturantStore.price;
    }

    getRestaurants() {
        return this.store.getRestaurants()
    }

    addRestaurant(restaurant) {
        this.store.addRestaurant(restaurant)
    }

    removeRestaurant(restaurant) {
        this.store.removeRestaurant(restaurant)
    }
}

export default Restaurant
